import Head from 'next/head'
import TileBar from "../Components/TileBar";
import Nav from "../Components/Nav";
import Layout from '../Components/Layout';

const index = () => {
  return (
    <Layout>
      <Head>
        <title>Mollie Dixon</title>
        <meta http-equiv="Content-Type" content="text/html; charset=utf8" />
        <meta name="description" content="The homepage for mollies business website"/>
        <meta name="viewport" content="width=device-width, initial-scale=1" />
        <link href="https://fonts.googleapis.com/css?family=Grand+Hotel|Lato" rel="stylesheet"></link>
      </Head>
      <Nav current="home"/>
      <TileBar />
    </Layout>
    );

}
export default index;
